angular.module("application.templates",[]).run(["$templateCache",function(n){n.put("login.html",'<md-content flex layout="row" layout-align="center center">\r\n    <md-card class="md-whiteframe-z5" flex flex-gt-sm="80" flex-gt-md="60" flex-gt-lg="40">\r\n        <md-toolbar>\r\n            <div class="md-toolbar-tools">\r\n                <h2><span class="title">{{ \'title_login\' | translate }}</span>\r\n            </h2></div>\r\n        </md-toolbar>\r\n        <md-card-content>\r\n            <form name="loginForm" ng-submit="login(credentials)">\r\n                <md-input-container>\r\n                    <label>{{ \'label_username\' | translate }}</label>\r\n                    <input autofocus name="username" ng-model="credentials.username" required minlength="4" maxlength="24" type="text">\r\n                    <div ng-if="loginForm.$submitted || loginForm.username.$touched" ng-messages="loginForm.username.$error">\r\n                        <div ng-message="required">{{ \'validation_required\' | translate }}</div>\r\n                        <div ng-message="minlength">{{ \'validation_minlength_4\' | translate }}</div>\r\n                        <div ng-message="maxlength">{{ \'validation_maxlength_24\' | translate }}</div>\r\n                    </div>\r\n                </md-input-container>\r\n\r\n                <md-input-container>\r\n                    <label>{{ \'label_password\' | translate }}</label>\r\n                    <input name="password" ng-model="credentials.password" required minlength="4" maxlength="24" type="password">\r\n                    <div ng-if="loginForm.$submitted || loginForm.password.$touched" ng-messages="loginForm.password.$error">\r\n                        <div ng-message="required">{{ \'validation_required\' | translate }}</div>\r\n                        <div ng-message="minlength">{{ \'validation_minlength_4\' | translate }}</div>\r\n                        <div ng-message="maxlength">{{ \'validation_maxlength_24\' | translate }}</div>\r\n                    </div>\r\n                </md-input-container>\r\n\r\n                <div layout="row" layout-align="end center">\r\n                    <md-button class="md-accent">\r\n                        {{ \'action_login\' | translate }}\r\n                    </md-button>\r\n                </div>\r\n            </form>\r\n        </md-card-content>\r\n    </md-card>\r\n</md-content>')}]);